import ParkList from "./ParkList";
import App from "./App";
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav className="navbar">
            <h1>U.S. National Parks</h1>
            <div className="links">
                <Link to="/">Home</Link>
                <Link to="/Parks" onClickPark={() => {App.setState({AllParksVisible: true}); }}>Parks</Link>
                <Link to="/Activities" onClickActivities={() => {App.setState({AllParksVisible: false}); }}>Activities</Link>
                <Link to="/Webcams" onClickParkWebcams={() => {App.setState({AllParksVisible: false}); }}>Webcams</Link>
            </div>
        </nav>
    );
}

export default Navbar;
